export const add_response_1 = ( item ) => ({
  type: 'ADD_RESPONSE_1',
  payload: item
})

export const add_response_time_1 = ( item ) => ({
  type: 'ADD_RESPONSE_TIME_1',
  payload: item
})

export const add_contrast_1 = ( item ) => ({
  type: 'ADD_CONTRAST_1',
  payload: item
})

export const add_array = ( arr ) => ({
  type: 'ADD_ARRAY',
  payload: arr
})
